o=A.wz("\u0646\u0627\u0628\u0644\u0633","Nablus is a city in the northern West Bank, Palestine, approximately 49 kilometers north of Jerusalem. It is the capital of the Nablus Governorate and a Palestinian commercial and cultural center. The city is known for its famous knafeh sweet dessert and its olive oil soap production.","Nablus was founded by the Roman Emperor Vespasian in 72 CE as Flavia Neapolis. The ancient city of Shechem was located nearby. Nablus has a rich and diverse history, having been ruled by the Romans, Byzantines, Crusaders, Mamluks, and Ottomans. It became a center for Palestinian nationalism during the 20th century.","nablus",A.b(["assets/images/nablus1.jpg","assets/images/nablus2.jpeg","assets/images/nablus3.jpeg"],l),!1,o,32.2222,35.2625,"Nablus")
